import Accordin from "./Accordin";

const AccordinMaker = ({ objects ,id ,name,suffix  }) => {

  return (
    <div className="mt-2">
      {objects.map((object) => (
        <Accordin key={object[id]} object={object} name={name} />
      ))}
    </div>
  );
};

export default AccordinMaker;
